import React from 'react'
import './styles/card.css'
import { Player } from "../";




export default function Card() {
    
    
    
    return (
        
            
                <div className ="card">
                    <div className="cardImage">
                        <img src="/images/films\drama\the-social-network/small.jpg"/>
                    </div>
                    <Player>
                        <Player.Button />
                        <Player.Video src="/videos/bunny.mp4" />
                    </Player>    

                        
                </div>    
            
            

        

        
    )
}
